import React from 'react';
import styled from '@emotion/styled';

const Tooltip = ({ text }) => {
  return <TooltipStyled>{text}</TooltipStyled>;
};

const TooltipStyled = styled.span`
  position: absolute;
  display: inline-block;
  padding: 20px;
  background: grey;
  border-radius: 5px;
  color: white;
`;

export default Tooltip;
